INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (36, 8, 100, 91002, "", "", 0, 0, 0, 40000, 1);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (37, 8, 150, 91002, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", "ぺコリーヌ", 0, 107501, 1, 40001, 1);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (38, 8, 150, 91002, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", "コッコロ", 0, 107601, 1, 40001, 2);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (39, 8, 150, 91002, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", "キャル", 0, 107801, 1, 40001, 3);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (40, 8, 150, 91002, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", "スズメ", 0, 107701, 1, 40001, 4);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (41, 8, 150, 91002, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", "タマキ", 0, 107901, 1, 40001, 5);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (42, 8, 150, 91002, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", "ぺコリーヌ", 0, 107501, 2, 40001, 6);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (43, 8, 150, 91002, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", "コッコロ", 0, 107601, 2, 40001, 7);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (44, 8, 150, 91002, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", "キャル", 0, 107801, 2, 40001, 8);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (45, 8, 150, 91002, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", "スズメ", 0, 107701, 2, 40001, 9);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (46, 8, 150, 91002, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", "タマキ", 0, 107901, 2, 40001, 10);
