INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (321, 2, 1, 24001, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 0, 125801, 1, 40011, 1);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (322, 2, 1, 24001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 0, 126001, 1, 40011, 2);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (323, 2, 1, 24001, "んーと。\nこれ、あげる。\nはい", "プレシア", 0, 126101, 1, 40011, 3);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (324, 2, 1, 24001, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 0, 125801, 2, 40011, 4);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (325, 2, 1, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 0, 126001, 2, 40011, 5);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (326, 2, 1, 24001, "お兄。\nきてくれて、うれしい", "プレシア", 0, 126101, 2, 40011, 6);
